package main

import (
	"fmt"
	"strconv"
)

func main() {
	text := ""
	fmt.Println(len(text))
	var numbers [999]int64
	for i := 0; i < 999; i++ {
		numbers[i], _ = strconv.ParseInt(text[i:i+1], 10, 0)
	}

	highest_product := int64(0)
	for i := 0; i < 998 - 13; i++ {
		product := int64(1)
		for j := 0; j < 13; j++ {
			product *= numbers[i + j]
		}
		if product > highest_product {
			highest_product = product
		}
	}

	fmt.Println(highest_product)
}
